import React from "react";
import { ListGroup } from "react-bootstrap";
import "./EnemyList.css";

const EnemyList = ({ enemyTracker }) => {
  return (
    <div className='list-container'>
    <ListGroup>
      {enemyTracker &&
        enemyTracker.map((enemy) => <ListGroup.Item action variant="light">{enemy}</ListGroup.Item>)}
    </ListGroup>
    </div>
  );
};

export default EnemyList;
